import React from 'react';
import SideNavigation from './components/SideContentWrap';
import MainContentWrapper from './components/MainContentWrap';
import AppEngine from './components/js/services';
import AppService from './components/js/services/AppService';

class App extends React.Component {
    constructor(props) {
        super();

        this.filtersData = {
            "name": "",
            "gender": "",
            "species": "",
            "origin": ""
        };

        this.AppData = {};

        AppEngine.init().then(response => {
            return response.json();
        }).then(response => {
            this.AppData = response;
            this.forceUpdate();
        }).catch(error => {
            console.warn(error);
        })
    }
    render() {
        return (
            <main className="app-wrapper clear-fix">
                <SideNavigation>

                </SideNavigation>
                <MainContentWrapper>

                </MainContentWrapper>
            </main>
        );
    }
}

export default App;
